import Link from "next/link";

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Sri Lanka</a>
    </Link>
    <Link href="/japan">
      <a style={linkStyle}>Japan</a>
    </Link>
  </div>
);

export default Header;
